import{_ as t,c as e,o as l,ag as i}from"./chunks/framework.Bw-5EFTY.js";const u=JSON.parse('{"title":"第73天 项目 14 第六部分","description":"","frontmatter":{},"headers":[],"relativePath":"100days/第73天_项目14_第六部分.md","filePath":"100days/第73天_项目14_第六部分.md"}'),r={name:"100days/第73天_项目14_第六部分.md"};function a(n,o,s,d,c,p){return l(),e("div",null,o[0]||(o[0]=[i('<h1 id="第73天-项目-14-第六部分" tabindex="-1">第73天 项目 14 第六部分 <a class="header-anchor" href="#第73天-项目-14-第六部分" aria-label="Permalink to &quot;第73天 项目 14 第六部分&quot;">​</a></h1><p>这又是一个颇具难度的项目，但你成功完成了它，希望你已经在思考如何运用所学技能了。无论是为购物应用集成地图、使用面容ID保护数据，还是其他用途，你在这里学到的每一项技能从长远来看都会有所回报。</p><p>今天我们进入项目的复习与挑战环节，在这一部分，你可以通过编写自己的代码进一步提升技能。正如拉尔夫·沃尔多·爱默生曾经说过的：“除非你尝试去做超出自己现有能力范围的事情，否则你永远不会成长。”所以，就把今天当作成长的一天吧！</p><p><strong>今天你需要完成第14个项目的总结章节，完成复习部分，然后攻克所有三个挑战。</strong></p><ul><li>愿望清单：总结</li><li>第14个项目复习：愿望清单</li></ul><h2 id="愿望清单-总结" tabindex="-1">愿望清单：总结 <a class="header-anchor" href="#愿望清单-总结" aria-label="Permalink to &quot;愿望清单：总结&quot;">​</a></h2><p>作者：Paul Hudson 2024年1月8日</p><p>我认为这是我们迄今为止规模最大的一个项目，但我们也涵盖了大量知识点：为自定义类型添加<code>Comparable</code>协议、查找文档目录、集成MapKit框架、使用生物识别认证、安全写入<code>Data</code>数据等等。当然，你现在又拥有了一个可实际运行的应用，希望你能完成下面的挑战，进一步完善它。</p><p>虽然我们制作的这个项目恰好以地图为核心，但地图在其他场景下作为附加功能也非常实用——比如显示会议举办地点、朋友的位置等，这些功能能为你的其他项目增添额外的实用细节。</p><h2 id="回顾所学内容" tabindex="-1">回顾所学内容 <a class="header-anchor" href="#回顾所学内容" aria-label="Permalink to &quot;回顾所学内容&quot;">​</a></h2><p>任何人都能看完一个教程，但要记住所学内容还需要切实的努力。我的职责是确保你能从这些教程中收获尽可能多的知识，完成后面的练习题可以帮助你检验自己的学习成果。</p><h2 id="挑战" tabindex="-1">挑战 <a class="header-anchor" href="#挑战" aria-label="Permalink to &quot;挑战&quot;">​</a></h2><p>学习编程的最佳方式之一之一就是尽可能多地编写自己的代码，因此我为你准备了三种扩展这个应用的方式，确保你能完全理解其中的原理。</p><ol><li>允许用户能够在标准模式和混合模式之间切换地图模式。</li><li>我们的应用在生物识别认证过程中发生错误时会无声无声地失败，因此请添加代码，通过弹窗显示这些错误。</li><li>再创建一个视图模型，这次是为<code>EditView</code>创建的。你在视图模型中放入哪些内容由你决定，但我建议将<code>dismiss</code>和<code>onSave</code>保留在视图本身中——前者使用环境变量，该变量只能由视图读取，而后者移到模型中实际上并无额外益处。</li></ol><p><strong>提示：</strong> 最后一个挑战需要你在<code>EditView</code>的初始化器中创建一个<code>State</code>实例——记住要在属性名前加上下划线！</p><h2 id="【练习题】愿望清单" tabindex="-1">【练习题】愿望清单 <a class="header-anchor" href="#【练习题】愿望清单" aria-label="Permalink to &quot;【练习题】愿望清单&quot;">​</a></h2><p>问题1/12：以下哪些表述是正确的？</p><ul><li><strong>选项1：</strong> <code>Comparable</code>协议要求我们告诉Swift，同一类型的两个对象中，哪个应在排序时排在前面。</li><li><strong>选项2：</strong> <code>Map</code>视图属于UIKit框架。</li></ul><p>问题2/12：以下哪些表述是正确的？</p><ul><li><strong>选项1：</strong> iOS可以通过<code>completeFileProtection</code>选项自动处理文件加密。</li><li><strong>选项2：</strong> <code>italic()</code>修饰符能将文本翻译成意大利语。</li></ul><p>问题3/12：以下哪些表述是正确的？</p><ul><li><strong>选项1：</strong> 当面容ID认证完成后，iOS会在主actor上执行我们指定的闭包。</li><li><strong>选项2：</strong> <code>Annotation</code>允许我们在地图中放置任何类型的SwiftUI视图。</li></ul><p>问题4/12：以下哪些表述是正确的？</p><ul><li><strong>选项1：</strong> 如果某个类型遵循<code>Comparable</code>协议，我们就能使用无需参数的<code>sorted()</code>方法版本。</li><li><strong>选项2：</strong> 向地图添加自定义文本的最佳方式是使用<code>Marker</code>。</li></ul><p>问题5/12：以下哪些表述是正确的？</p><ul><li><strong>选项1：</strong> Swift不允许我们在字典中放入数组。</li><li><strong>选项2：</strong> 以原子方式写入数据意味着iOS会先写入临时文件，然后再执行重命名操作。</li></ul><p>问题6/12：以下哪些表述是正确的？</p><ul><li><strong>选项1：</strong> Swift中的字符串和整数本身已遵循<code>Comparable</code>协议。</li><li><strong>选项2：</strong> 我们的文档目录只能存储文本或JSON，不能存储其他类型的文件。</li></ul><p>问题7/12：以下哪些表述是正确的？</p><ul><li><strong>选项1：</strong> 每个iOS应用都有一个可用于存储文件的文档目录。</li><li><strong>选项2：</strong> 所有iOS设备都支持面容ID。</li></ul><p>问题8/12：以下哪些表述是正确的？</p><ul><li><strong>选项1：</strong> 所有类都应使用<code>@Observable</code>宏。</li><li><strong>选项2：</strong> <code>CLLocationCoordinate2D</code>中的“CL”代表Core Location（核心定位）。</li></ul><p>问题9/12：以下哪些表述是正确的？</p><ul><li><strong>选项1：</strong> 触控ID和面容ID均由LocalAuthentication（本地认证）框架提供支持。</li><li><strong>选项2：</strong> MVVM代表“Multiple Views, Varying Models”（多视图，多模型）。</li></ul><p>问题10/12：以下哪些表述是正确的？</p><ul><li><strong>选项1：</strong> SwiftUI不允许我们将文本字段直接绑定到可选字符串属性。</li><li><strong>选项2：</strong> <code>CLLocationCoordinate2D</code>遵循<code>Codable</code>协议。</li></ul><p>问题11/12：以下哪些表述是正确的？</p><ul><li><strong>选项1：</strong> 在<code>URLSession</code>上调用<code>data(from:)</code>方法必须使用<code>await</code>。</li><li><strong>选项2：</strong> 不能在SwiftUI视图中使用<code>switch</code>语句。</li></ul><p>问题12/12：以下哪些表述是正确的？</p><ul><li><strong>选项1：</strong> SwiftUI要求地图标注数据必须具有唯一标识。</li><li><strong>选项2：</strong> 即使用户删除了应用，其文档目录仍会保留在设备上。</li></ul>',40)]))}const _=t(r,[["render",a]]);export{u as __pageData,_ as default};
